About Game:
************
Discover Detective Riddles - Sherlock's Heritage and enjoy a challenging nonogram puzzle adventure! 6 mysterious cases are waiting for you to be solved. Combine your detective skills with your outstanding puzzle skills and uncover the crimes, catch the villain and save the citizens. Are you ready to prove you're a true Sherlock? Play Detective Riddles - Sherlock's Heritage now! 

Game Features:
**************
* step in the shoes of a detective, uncover crimes and catch the villain
* play 120 challenging nonogram puzzle levels in 6 different locations
* enjoy an exciting detective world with a mysterious atmosphere of secrets
* complete over 9 hours of gameplay, special tasks, and earn over 15 trophies 

